import { NavLink } from "react-router-dom";

const MainHeader = () =>{

   return (
    <div>
        <ul>
            <li>
                <NavLink to="/Page1"> Home</NavLink>
            </li>
            
            <li>
                <NavLink to="/Page2">About </NavLink>
            </li>
        </ul>
    </div>
   )

}

export default MainHeader;
